import React from 'react';
import './index.css';

function Spin(){
  return(
    <React.Fragment>
      <div className="spin-wrap">
        <div className="spin-container">
            <div className="spin-mohi">
              <span>M</span>
            </div>
        </div>
      </div>
    </React.Fragment>
  )
}

export default Spin;
